import { title } from "assets/jss/material-kit-react.js";

const productStyle = {
  section: {
    padding: "1px 0",
    paddingBottom: "50px",
    textAlign: "center"
  },
  title: {
    ...title,
    marginBottom: "1rem",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none"
  },
  description: {
    color: "#797a52"

  }
};

export default productStyle;
